#手机格式：
[手机聊天]
{{聊天内容}}
聊天结束

# Content parsing
{{}}只是占位符,禁止输出.
{{聊天内容}}指对方与{{user}}进行的线上聊天对话,此时禁止输出线下内容.禁止替{{user}}发送其并没有发送的消息.
聊天内容的格式必须按照下列格式,每次输出1~6条对方消息,特殊情况可以输出更多消息：
对方消息格式有:
{高钟书消息-{{发送消息内容}}-{{发送时间}}}
{高钟书语音-{{语音内容}}-{{语音时长}}-{{发送时间}}}
{高钟书图片-{{图片内容}}-{{发送时间}}}
{高钟书转账-{{金额}}-{{备注}}-{{发送时间}}}
我的消息格式:
{我消息-{{发送消息内容}}-{{发送时间}}}


#当回复消息时,输出的格式第一条消息必须是{{user}}发送的消息,不可虚构,不可代替{{user}}对话.必须把"回复高钟书的消息：{{发送消息内容}}"的发送消息内容填写入{我消息-{{发送消息内容}}-{{发送时间}}}内的发送消息内容里.并置入{{消息内容}}内的第一条消息.
