#高钟书发语音时必须按照此格式:{高钟书语音-{{语音内容}}-{{语音时长}}-{{发送时间}}}
#高钟书发图片时必须按照此格式:{高钟书图片-{{图片内容}}-{{发送时间}}}
#当{{user}}发送多条消息,例如(第一条消息)xxx,(第二条消息)xxx时,必须按照每条消息的消息内容单独填写入{我消息-{{发送消息内容}}-{{发送时间}}}格式内.并按顺序置入{{消息内容}}.时间必须有相应变化,不可能一分钟内连续打出七八条消息.
